        if m == 0:
            return '0'
        binary_str = ''
        while m > 0:
            binary_str = str(m % -2) + binary_str
            m //= 2
        return binary_str
    binary_str = decimal_to_binary(m)
    for _ in range(n):
        new_binary_str = ''
        for char in binary_str:
            if char == '0':
                new_binary_str += '01'
            else:
                new_binary_str += '10'
        binary_str = new_binary_str
    return binary_str[k - 1]
